import React ,{useRef,useEffect} from "react"
import "./Login_user_interface.css"
const Login_user_interface = () => {


  const textRef = useRef(null);
  
  useEffect(() => {
    const text = 'NAHDI GHAITH'; // Text to type
    let index = 0;
    const speed = 100; // Typing speed in milliseconds

    const type = () => {
      if (index < text.length) {
        textRef.current.textContent += text.charAt(index);
        index++;
        setTimeout(type, speed);
      }
    };

    type();
  }, []);


  return (
    <div className='Login_user_interface'>
        <div className='Login_user_interface_Icon'> <img src="images/user.png" alt="user"/></div>
        <div className='Login_user_interface_user_name'>  NAHDI GHAITH</div>
        <div className='Login_user_interface_sign_in'><button>SIGN IN  </button> </div>
    </div>
  )
}

export default Login_user_interface
